pragma solidity >=0.5.16;

import "./ERC721Tradable.sol";
import "@openzeppelin/contracts/ownership/Ownable.sol";
import "./Strings.sol";

contract PixelCanvas is ERC721Tradable {
    using Strings for string;

    event Colored(uint256 newColor, uint256 token_id);
    event Indexed(uint16 index, uint256 token_id);

    uint16[] private indexTaken;

    constructor(address _proxyRegistryAddress) public ERC721Tradable("PixelCanvas", "PXC", _proxyRegistryAddress) { }

    function baseTokenURI() public pure returns (string memory) {
        return "/api/token/";
    }

    function contractURI() public pure returns (string memory) {
        return "/contract";
    }

    function mint(uint256 color, uint16 index) payable public {
        require(color <= 16777215, "Not a valid color");
        require(index <= 63, "Not a valid index");
        require(msg.value >= 0.01 ether, "Not enough ETH");
        require(currentTokenId() <= 64);
        require(isIndexTaken(index) == false);
        mintTo(msg.sender);
        indexTaken.push(index);
        emit Indexed(index, currentTokenId());
        emit Colored(color, currentTokenId());
    }

    function updateColor(uint256 newColor, uint256 token_id) public {
        require(newColor <= 16777215, "Not a valid color");
        require(isOwned(msg.sender, token_id));
        emit Colored(newColor, token_id);
    }

    function isOwned(address owner, uint256 token_id) internal returns (bool) {
        bool contains = false;
        for (uint i=0; i < _tokensOfOwner(owner).length; i++) {
            if (token_id == _tokensOfOwner(owner)[i]) {
                contains = true;
            }
        }
        return contains;
    }

    function isIndexTaken(uint16 index) internal returns (bool) {
        bool taken = false;
        for (uint i=0; i < indexTaken.length; i++) {
            if (index == indexTaken[i]) {
                taken = true;
                break;
            }
        }
        return taken;
    }
}
